Here's the same definition from the check.json page , except the host argument references an attribute named Host. { "id": "icmp", "name": "ICMP", "type": "icmp", "group": "example", "score_weight": 1, "definition": { "host": "{{.Host}}" }
} An admin-attribs.json file for this check could look like this. { "Host": "localhost"
} Note that the Host key is case-sensitive. Also, if the Host attribute should be a user attribute, the file would have the same format, but it would be named user-attribs.json instead.

