Let's go through an example of adding multiple teams to Scorestack to see how we can use the features of the add-team.sh script to our advantage. We want to add 5 teams to Scorestack for a competition. Let's use an example DNS check definition with some associated administrator attributes. check.json { "id": "dns", "name": "DNS", "type": "dns", "group": "example", "score_weight": 1, "definition": { "Server": "{{.Server}}", "Port": "{{.Port}}", "Fqdn": "{{.Fqdn}}", "ExpectedIP": "{{.ExpectedIP}}" }
} admin-attribs.json { "Server": "192.168.1.10", "Port": "53", "Fqdn": "www.team01.com", "ExpectedIP": "192.168.1.98"
} This DNS check will query the DNS server at 192.168.1.10 for the host host1.com, and will expect the response to report the host's IP as 192.168.1.98. We can use the ${TEAM} and ${TEAM_NUM} templates to make this check a bit more generic so it'll work for all of the teams! The following is how we would do the templating: check.json with Team templates { "id": "dns", "name": "DNS", "type": "dns", "group": "${TEAM}", "score_weight": 1, "definition": { "Server": "{{.Server}}", "Port": "{{.Port}}", "Fqdn": "{{.Fqdn}}", "ExpectedIP": "{{.ExpectedIP}}" }
} admin-attribs.json with Team templates { "Server": "192.168.${TEAM_NUM}.10", "Port": "53", "Fqdn": "www.${TEAM}.com", "ExpectedIP": "192.168.${TEAM_NUM}.98"
} Finally, let's see what the checks will look like once the script performs the initial templating and modifications. In this example, we'll assume the script was run with one argument - team05. check.json modified for team05 { "id": "dns-team05", "name": "DNS", "type": "dns", "group": "team05", "score_weight": 1, "definition": { "Server": "{{.Server}}", "Port": "{{.Port}}", "Fqdn": "{{.Fqdn}}", "ExpectedIP": "{{.ExpectedIP}}" }
} admin-attribs.json modified for team05 { "Server": "192.168.5.10", "Port": "53", "Fqdn": "www.team05.com", "ExpectedIP": "192.168.5.98"
}
